import React from "react";

class Home extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h2>Detectar Objeto</h2>

        <form
          action="/detectar-objeto/"
          enctype="multipart/form-data"
          method="post"
        >
          <label>Imagen:</label>
          <input name="img1" type="file"></input>
          <br></br>
          <input type="submit" value="Aceptar"></input>
        </form>
      </React.Fragment>
    );
  }
}
export default Home;
